INSERT INTO `drupal_aggregator_item` VALUES (1,1,'GM Nears Human-Resources Hire','http://online.wsj.com/article/SB10001424052702304520804576349081737764312.html?mod=rss_whats_news_us','','General Motors is close to hiring an auto-industry outsider to lead its human-resources operations after government-imposed pay limits slowed the search for months.',1306510389,''),(2,1,'EU Vows No Backdown on Basel','http://online.wsj.com/article/SB10001424052702304520804576348961217921404.html?mod=rss_whats_news_us','','The European Union will not back away from implementing new banking rules that cover how much lenders need to hold against possible future losses, said the commissioner responsible for market rules, Michel Barnier.',1306494726,''),(3,1,'Dexia to Speed Up Restructure','http://online.wsj.com/article/SB10001424052702304520804576349033969588252.html?mod=rss_whats_news_us','','Belgian bank Dexia said it was speeding up its restructuring plan in a move that will reduce its U.S. exposure and improve earnings forecasts but will result in a $5.09 billion hit to its second-quarter results.',1306500363,''),(4,1,'HSBC Chairman\'s Rebuke','http://online.wsj.com/article/SB10001424052702304520804576349172796474898.html?mod=rss_whats_news_us','','HSBC Holdings received a symbolic slap on the wrist from shareholders at the bank\'s annual meeting, as a sizeable minority of votes opposed the company\'s remuneration plan and some of its board members.',1306522235,''),(5,1,'Dark Horse Explores IMF Bid','http://online.wsj.com/article/SB10001424052702304520804576348633776824992.html?mod=rss_whats_news_us','','Israeli central banker Stanley Fischer is examining a formal bid to head the International Monetary Fund, and figures he has an outside shot at the job if there is a deadlock in the voting.',1306546283,''),(6,1,'Big Indonesia Banks Chase Microloans','http://online.wsj.com/article/SB10001424052702303654804576343521563352218.html?mod=rss_whats_news_us','','Top banks in Indonesia are rapidly rolling out hundreds of microlending branches across the archipelago in the latest push by financial institutions to expand their reach—and boost earnings—by serving the less affluent.',1306538647,''),(7,1,'Consumer Spending Slows','http://online.wsj.com/article/SB10001424052702304066504576349080279317732.html?mod=rss_whats_news_us','','Spending by Americans slowed in April, rising 0.4% from a month earlier, a sign that rising prices for gasoline and groceries squeezed the economic recovery going into spring.',1306546233,''),(8,1,'New Greek Debt Risk: Word Games','http://online.wsj.com/article/SB10001424052702303654804576349741579095206.html?mod=rss_whats_news_us','','Whether a Greek debt workout is called a \"soft restructuring,\" a \"reprofiling\" or another term could determine whether sellers of credit default swaps have to pay.',1306550361,''),(9,1,'Foreclosure Activity Tumbled in April','http://online.wsj.com/article/SB10001424052702304520804576349881152311812.html?mod=rss_whats_news_us','','Banks initiated fewer foreclosures in April than in any month since late 2008, even though the number of loans in foreclosure remains near records, offering the latest evidence that banks are struggling to repair hobbled foreclosure processes.',1306541500,''),(10,1,'FCC Asks AT&T for Pricing, Spectrum Data','http://online.wsj.com/article/SB10001424052702304520804576349693790911166.html?mod=rss_whats_news_us','','Federal telecommunications regulators reviewing AT&T\'s proposed acquisition of T-Mobile on Friday delivered their first request for information on the deal, demanding detailed data on AT&T\'s pricing, spectrum holdings and any alternatives it considered to solve its capacity constraints.',1306542184,''),(11,1,'Wells Fargo Plans Insurance Growth','http://online.wsj.com/article/SB10001424052702304066504576349382360033562.html?mod=rss_whats_news_us','','Wells Fargo, the giant bank that already runs the fifth-largest insurance broker in the world by revenue, is seeking to double that revenue in the next decade.',1306541074,''),(12,1,'RIM Hopes Cars Drive PlayBook Sales','http://online.wsj.com/article/SB10001424052702304066504576349763614933844.html?mod=rss_whats_news_us','','Research in Motion may be falling behind rivals in the smartphone war, but it is hoping to pull ahead in the brewing battle to bring mobile technology into the car.',1306550481,''),(13,1,'Two More Plead Guilty in \'Expert Network\' Case','http://online.wsj.com/article/SB10001424052702304066504576349520781424078.html?mod=rss_whats_news_us','','A former hedge-fund manager and an ex-analyst at a technology firm have become the latest to plead guilty to criminal charges related to an alleged insider-trading scheme involving \"expert network\" firms.',1306548088,''),(14,1,'Lockheed Network Suffers Breach','http://online.wsj.com/article/SB10001424052702303654804576350083016866022.html?mod=rss_whats_news_us','','Hackers may have infiltrated the networks of top U.S. weapons manufacturer Lockheed Martin, according to a person with knowledge of the attacks.',1306550072,''),(15,1,'Fiat to Acquire Majority of Chrysler','http://online.wsj.com/article/SB10001424052702304520804576349520340473648.html?mod=rss_whats_news_us','','Fiat said it plans in the next 10 days to buy the U.S. Treasury\'s 6% stake in Chrysler, giving it majority control of the auto maker and raising questions about whether Chrysler will go ahead with a public offering of shares.',1306530712,''),(16,1,'Biden Touts Auto Industry Turnaround','http://online.wsj.com/article/SB10001424052702304066504576351032918479102.html?mod=rss_whats_news_us','','Vice President Joe Biden touted the Obama administration\'s bailouts of U.S. auto makers in the White House radio address, saying they succeeded in turning around the auto industry and helped the economic recovery.',1306583151,''),(17,1,'No May Flowers Bloom for U.S. Stock Investors','http://online.wsj.com/article/SB10001424052702303654804576349870406373248.html?mod=rss_whats_news_us','','Selling in May and going away turned out to be a good idea. Despite Friday\'s 38.82-point rise, U.S. stocks ended the week in negative territory, pushing their losing streak to a fourth week.',1306538236,''),(18,1,'Japan and EU to Explore Trade Pact','http://online.wsj.com/article/SB10001424052702304066504576351081332693352.html?mod=rss_whats_news_us','','Japan and the European Union agreed to look into a free trade pact, but their leaders stopped short of launching formal talks for the deal, which Japan sees as crucial for exports to its third-largest trading partner.',1306590169,''),(19,1,'Norwegian Shipping Tycoon in Spotlight','http://online.wsj.com/article/SB10001424052702303654804576349572125616828.html?mod=rss_whats_news_us','','U.S. regulators\' lawsuit over alleged manipulation of crude-oil prices in 2008 has shone a spotlight on John Fredriksen, a shipping tycoon whose risky bets, shrewd investments and buccaneering style have made him Norway\'s richest man.',1306607081,''),(20,1,'Dispute Puts Trade Deals at Risk','http://online.wsj.com/article/SB10001424052702304066504576349832361669832.html?mod=rss_whats_news_us','','The centerpiece of the American trade agenda—a trio of international trade pacts worth $13 billion in new U.S. exports—is in peril as Democrats and Republicans battle over a program that provides aid to U.S. workers.',1306552323,''),(21,1,'Air France Crash Report Shows Confused Cockpit','http://online.wsj.com/article/SB10001424052702304066504576349112775425674.html?mod=rss_whats_news_us','','Air France jetliner pilots continued to pull the nose up sharply even as the stalled Airbus A330 plummeted toward the Atlantic Ocean in 2009, according to accident investigators.',1306596788,''),(22,1,'Einhorn Deal Could Allow Controlling Interest in Mets','http://online.wsj.com/article/SB10001424052702304066504576351962448831114.html?mod=rss_whats_news_us','','David Einhorn\'s $200 million agreement with the New York Mets to buy a minority stake in the team is essentially a loan that, after three years, could allow the hedge-fund titan to acquire a controlling interest in the team.',1306630216,''),(23,1,'CBD Chairman Diniz Contacts Carrefour to Explore \'Growth\'','http://online.wsj.com/article/SB10001424052702304066504576352101947277830.html?mod=rss_whats_news_us','','Abilio Diniz, the chairman of Brazil\'s largest retailer, Companhia Brasileira de Distribuicao, has reached out to French retail giant Carrefour to explore \"growth\" opportunities, a move that could threaten a long-standing deal CBD has with Carrefour rival Groupe Casino.',1306629368,''),(24,2,'Critic’s Notebook: Books to Bury Yourself In','http://www.nytimes.com/2011/05/27/books/summers-beach-books-get-a-makeover.html?partner=rss&emc=rss','By JANET MASLIN','The beach book this summer is likely to have new names and new twists, even when it comes to Scandinavian mysteries.',1306520563,'http://www.nytimes.com/2011/05/27/books/summers-beach-books-get-a-makeover.html'),(25,2,'When Play in Paris Resumes, So Does Djokovic’s Undefeated Streak','http://www.nytimes.com/2011/05/29/sports/tennis/djokovic-streak-hits-42-as-he-beats-del-potro-in-french-open.html?partner=rss&emc=rss','By CHRISTOPHER CLAREY','Novak Djokovic defeated Juan Martín Del Potro when their suspended match at Roland Garros resumed on Saturday.',1306626476,'http://www.nytimes.com/2011/05/29/sports/tennis/djokovic-streak-hits-42-as-he-beats-del-potro-in-french-open.html'),(26,2,'When Everything Is Gone, Including a Sense of Direction','http://www.nytimes.com/2011/05/29/us/29joplin.html?partner=rss&emc=rss','By DAN BARRY, RICHARD A. OPPEL Jr. and A. G. SULZBERGER','The tornado that carved through southwestern Missouri last Sunday leveled parts of Joplin so completely that the community’s inner GPS remains out of whack.',1306626318,'http://www.nytimes.com/2011/05/29/us/29joplin.html'),(27,2,'Report Details Last Minutes of Doomed Air France Jet','http://www.nytimes.com/2011/05/28/world/europe/28flight.html?partner=rss&emc=rss','By NICOLA CLARK','An initial chronology confirmed that a loss of consistent speed readings triggered the events that led to the 2009 crash.',1306563634,'http://www.nytimes.com/2011/05/28/world/europe/28flight.html'),(28,2,'Obama Cites Poland As Model for Arab Shift','http://www.nytimes.com/2011/05/29/world/europe/29prexy.html?partner=rss&emc=rss','By MARK LANDLER','Visiting Warsaw, the president said Poland’s peaceful overthrow of Communism provided lessons for countries struggling with the chaotic aftermath of popular revolts.',1306627184,'http://www.nytimes.com/2011/05/29/world/europe/29prexy.html'),(29,2,'In Evidence: a Terrorist’s To-Do List','http://www.nytimes.com/2011/05/29/world/asia/29headley.html?partner=rss&emc=rss','By GINGER THOMPSON','Hours of testimony last week by a confessed terrorist provided a rare look at the clandestine world of Islamic extremists.',1306623908,'http://www.nytimes.com/2011/05/29/world/asia/29headley.html'),(30,2,'Funny or Die: Groupon’s Fate Hinges on Words','http://www.nytimes.com/2011/05/29/business/29groupon.html?partner=rss&emc=rss','By DAVID STREITFELD','The e-mail marketer hopes that its staff of 400 writers and editors will keep it one step ahead of its discounting competitors on the Web.',1306625422,'http://www.nytimes.com/2011/05/29/business/29groupon.html'),(31,2,'French System Tints View of the Strauss-Kahn Case','http://www.nytimes.com/2011/05/29/world/europe/29france.html?partner=rss&emc=rss','By SCOTT SAYARE','Dismay in France over what many view as rough treatment is rooted in an unfamiliarity with an American justice system that differs profoundly from the French model.',1306631143,'http://www.nytimes.com/2011/05/29/world/europe/29france.html'),(32,2,'Barcelona 3, Manchester United 1 : In Dominant Display of Ball Control, Barcelona Wins the Champions League','http://www.nytimes.com/2011/05/29/sports/soccer/in-dominant-display-barcelona-wins-champions-league.html?partner=rss&emc=rss','By JOHN BRANCH','By defeating Manchester United, Barcelona staked its claim to the most prestigious club title in the world and fueled a historical debate about whether it is one of the best teams in soccer history.',1306631143,'http://www.nytimes.com/2011/05/29/sports/soccer/in-dominant-display-barcelona-wins-champions-league.html'),(33,2,'Bin Hammam Withdraws From FIFA Presidential Race','http://www.nytimes.com/reuters/2011/05/28/sports/soccer/sports-us-soccer-fifa-binhammam.html?partner=rss&emc=rss','By REUTERS','Mohamed Bin Hammam of Qatar withdrew his candidacy for the post of FIFA president on Saturday, one day before he is due to face an Ethics Committee hearing into bribery allegations.',1306630142,'http://www.nytimes.com/reuters/2011/05/28/sports/soccer/sports-us-soccer-fifa-binhammam.html'),(34,2,'War Crimes Suspect Could Be Extradited Tuesday','http://www.nytimes.com/2011/05/29/world/europe/29serbia.html?partner=rss&emc=rss','By STEVEN ERLANGER and DOREEN CARVAJAL','Serbian officials vowed to track down those who helped hide Ratko Mladic, but their prime interest now is to get him packed off to the war crimes tribunal in The Hague.',1306630315,'http://www.nytimes.com/2011/05/29/world/europe/29serbia.html'),(35,2,'Taliban Bomber Infiltrates Afghan-NATO Meeting, Killing Police Official and Others','http://www.nytimes.com/2011/05/29/world/asia/29afghan.html?partner=rss&emc=rss','By RAY RIVERA','The police official’s death raises concerns about stability in the region as NATO begins turning over security to Afghan forces in July.',1306630315,'http://www.nytimes.com/2011/05/29/world/asia/29afghan.html'),(36,2,'In Libyan Rebel Capital, Shouts of Thanks to America and the West','http://www.nytimes.com/2011/05/29/world/africa/29benghazi.html?partner=rss&emc=rss','By ROD NORDLAND','In Benghazi, Libya’s rebel capital, Westerners are treated with a warmth and gratitude rarely seen in any Muslim country.',1306626033,'http://w