.com/2011/05/29/world/europe/29envoy.html?partner=rss&emc=rss','By PETER BAKER','Michael McFaul, the architect of President Obama’s “reset policy” for Russia, has been named the next ambassador to that country.',1306663472,'http://www.nytimes.com/2011/05/29/world/europe/29envoy.html'),(43,1,'Russia to Lift Grain Export Ban','http://online.wsj.com/article/SB10001424052702304066504576351011167638594.html?mod=rss_whats_news_us','','Russian Prime Minister Vladimir Putin says the country will lift its ban on grain exports on July 1.',1306690423,''),(44,1,'Japan Fears Postquake Investment Outflows','http://online.wsj.com/article/SB10001424052702303654804576346970975211598.html?mod=rss_whats_news_us','','The March 11 earthquake and its aftermath have raised the risk of an outflow of foreign capital and talent from Japan, complicating the government\'s goal of attracting more inward investment.',1306686590,''),(45,1,'Fed\'s Hoenig Sees Need to Lift Rates','http://online.wsj.com/article/SB10001424052702303657404576353393578116276.html?mod=rss_whats_news_us','','Thomas Hoenig, president of the Federal Reserve Bank of Kansas City, said the U.S. should learn lessons from the last decade when low interest rates ended up discouraging savings in the U.S. and causing economic problems.',1306694455,''),(46,1,'Yemen Unrest Spreads South','http://online.wsj.com/article/SB10001424052702303657404576353221982484868.html?mod=rss_whats_news_us','','Islamic fundamentalists battled forces loyal to President Ali Abdullah Saleh in Yemen\'s third-largest city, expanding the unrest from the capital in the north to the southern reaches of the nation.',1306687347,''),(47,1,'Zuma Seeks Role in Libya Talks','http://online.wsj.com/article/SB10001424052702303745304576353333896326362.html?mod=rss_whats_news_us','','South Africa\'s President Jacob Zuma is heading to Libya, the latest in a flurry of peacemaking trips that reflects a foreign policy driven by crisis and by ambition for an elevated role in 