sia/30afghanistan.html'),(53,2,'North Sudan Threatens to Invade Two Border Regions','http://www.nytimes.com/2011/05/30/world/africa/30sudan.html?partner=rss&emc=rss','By JEFFREY GETTLEMAN and JOSH KRON','The northern army is risking war with the south just weeks before southern Sudan is due to split off as an independent country, Western and Sudanese officials said Sunday.',1306692070,'http://www.nytimes.com/2011/05/30/world/africa/30sudan.html'),(54,1,'An Abundance of Advisers May Spoil Some Flotations','http://online.wsj.com/article/SB10001424052702303745304576353433186240552.html?mod=rss_whats_news_us','','Bringing a lot of investment banks on board can spoil an initial public offering, data from research firm Dealogic suggest.',1306723821,''),(55,1,'Samsung Expands Ties to Android on Tablets','http://online.wsj.com/article/SB10001424052702303745304576354312309980754.html?mod=rss_whats_news_us','','Samsung Electronics plans to deepen its relationship with Google by depending on the U.S. company\'s Android mobile device software to run future versions of its tablets as it ramps up in the increasingly competitive sector.',1306748299,''),(56,1,'Russia Surprises With Rate Decision','http://online.wsj.com/article/SB10001424052702303657404576354741896039896.html?mod=rss_whats_news_us','','In an unexpected move, Russia\'s central bank raised its deposit rate by 0.25 percentage point, surprising markets by tightening monetary policy for the second consecutive month.',1306747104,''),(57,1,'Europe\'s Markets Edge Higher','http://online.wsj.com/article/SB10001424052702303657404576354662163444214.html?mod=rss_whats_news_us','','European stock markets edged higher in cautious trading, with the difficulties surrounding the euro-zone periphery still at the forefront of investors\' thinking. However, volumes have been thin given the public holidays in both the U.K. and the U.S.',1306746857,''),(58,1,'Jobs Report Could Sting Dollar','http://online.wsj.com/article/SB10001424052702