oints Army Leader as Chairman of Joint Chiefs','http://www.nytimes.com/2011/05/31/us/31dempsey.html?partner=rss&emc=rss','By HELENE COOPER and THOM SHANKER','As the country’s highest-ranking military officer, Gen. Martin E. Dempsey will help steer the armed forces through conflicts in three Muslim countries.',1306778303,'http://www.nytimes.com/2011/05/31/us/31dempsey.html'),(104,2,'Insurgents Attack NATO Base in Afghanistan','http://www.nytimes.com/2011/05/31/world/asia/31afghanistan.html?partner=rss&emc=rss','By ROD NORDLAND','The Taliban launched a sophisticated attack on Monday against a NATO base in the western Afghan city of Herat, killing at least four people and wounding more than 30.',1306786155,'http://www.nytimes.com/2011/05/31/world/asia/31afghanistan.html'),(105,2,'Zuma Visit Raises Hopes for Libya Deal','http://www.nytimes.com/2011/05/31/world/africa/31libya.html?partner=rss&emc=rss','By JOHN F. BURNS and J. DAVID GOODMAN','President Jacob Zuma of South Africa received a raucous red carpet greeting on Monday as he arrived in Libya for meetings with Col. Muammar el-Qaddafi.',1306791228,'http://www.nytimes.com/2011/05/31/world/africa/31libya.html'),(106,2,'Over 100 Libyan Army Members Defect From Gaddafi','http://www.nytimes.com/reuters/2011/05/30/world/africa/news-us-libya-officers.html?partner=rss&emc=rss','By REUTERS','Eight high-ranking Libyan army officers appeared in Rome on Monday saying they were part of a group of as many as 120 military officials and soldiers who had defected from Muammar Gaddafi\'s side in recent days.',1306778589,'http://www.nytimes.com/reuters/2011/05/30/world/africa/news-us-libya-officers.html'),(107,2,'Inspectors Pierce Iran’s Cloak of Nuclear Secrecy','http://www.nytimes.com/2011/05/31/science/31nuke.html?partner=rss&emc=rss','By WILLIAM J. BROAD','The world’s atomic watchdogs unveiled new details of what they call “possible military dimensions” of Iran’s nuclear program.',1306791028,'http://www.nytimes.com/2011/05/31/scie