57734056747802.html?mod=rss_whats_news_us','','A key municipal-bond trade group prohibited institutions from serving as both financial adviser and underwriter on new bond issues.',1306872335,''),(146,1,'NCR Sues Blockbuster              Over Movie Kiosks','http://online.wsj.com/article/SB10001424052702303657404576357791199153246.html?mod=rss_whats_news_us','','NCR is suing Blockbuster, to thwart a move to terminate its right to use the Blockbuster Express trademark on movie-rental kiosks. NCR, which makes the vending machines, said it has permission to use the trademark until 2016.',1306874672,''),(147,1,'EU Mulls Wider Tax Mandate','http://online.wsj.com/article/SB10001424052702303745304576357610086319804.html?mod=rss_whats_news_us','','The European Commission is considering laying claim to tens of billions of euros in tax revenues from across the EU, a change that would significantly boost the commission\'s financial power.',1306880538,''),(148,1,'Doha Trade Deal Seems Likely','http://online.wsj.com/article/SB10001424052702304563104576357463755257444.html?mod=rss_whats_news_us','','The World Trade Organization\'s 153 members Tuesday in Geneva agreed to a less-ambitious Doha round of global trade talks, stripping away enough contentious issues that it now appears feasible to finish a deal by the end of 2011.',1306877875,''),(149,1,'Lehman Veteran Is Back in Game','http://online.wsj.com/article/SB10001424052702304563104576357502905005360.html?mod=rss_whats_news_us','','As the financial crisis recedes, Ex-Lehman executive Mark Walsh is mounting a low-key comeback at a new real-estate firm by leaning on connections made before the real-estate bubble burst.',1306887571,''),(150,1,'Exxon Fuels a Chemicals Drive','http://online.wsj.com/article/SB10001424052702303654804576347672499196238.html?mod=rss_whats_news_us','','Exxon Mobil is nearing completion of one of the biggest projects in its corporate history in a big bet that Asian consumers will have a long-term demand for diapers and dent-resistant auto bumpers.',1306886764,''),(151,1,'Housing Imperils Recovery','http://online.wsj.com/article/SB10001424052702303657404576357170425058088.html?mod=rss_whats_news_us','','Home prices have sunk to 2002 levels, effectively wiping out almost a decade\'s worth of home equity across the U.S. and imperiling the fragile economic recovery as Americans confront the falling value of their biggest investment.',1306887636,''),(152,2,'ArtsBeat: Venice Biennale: Up the Canal Without a Water Bus','http://artsbeat.blogs.nytimes.com/2011/05/31/venice-biennale-up-the-canal-without-a-water-bus/?partner=rss&emc=rss','By CAROL VOGEL','A one-day strike puts a crimp in Biennale activities.',1306866636,'http://artsbeat.blogs.nytimes.com/2011/05/31/venice-biennale-up-the-canal-without-a-water-bus/'),(153,2,'ArtsBeat: ‘Big Bambú’ Rises in Venice','http://artsbeat.blogs.nytimes.com/2011/05/31/venice-biennale-big-bambu-italian-style/?partner=rss&emc=rss','By ROBERTA SMITH','The strange sights and sounds — or lack thereof — in Venice as artists and tourists prepare for the city’s 2011 Biennale, which opens Saturday.',1306872139,'http://artsbeat.blogs.nytimes.com/2011/05/31/venice-biennale-big-bambu-italian-style/'),(154,2,'A New York Dog Makes Its Hollywood Debut','http://www.nytimes.com/2011/06/01/us/01papayaking.html?partner=rss&emc=rss','By ADAM NAGOURNEY','Papaya King has landed in Los Angeles, a city that might be as crazy and competitive about food as New York is.',1306885626,'http://www.nytimes.com/2011/06/01/us/01papayaking.html'),(155,2,'From Spain, Charges Against 20 in the Killing of 6 Priests in El Salvador in 1989','http://www.nytimes.com/2011/05/31/world/americas/31salvador.html?partner=rss&emc=rss','By ELISABETH MALKIN','The killing of six Jesuit priests, as well as their housekeeper and her daughter, was a watershed moment in El Salvador’s brutal civil war.',1306878991,'http://www.nytimes.com/2011/05/31/world/americas/31salvador.html'),(156,2,'Egypt