78,''),(187,1,'Nokia Shares Slump','http://online.wsj.com/article/SB10001424052702303657404576359230836473332.html?mod=rss_whats_news_us','','Nokia shares fell another 4.8% as analysts cut forecasts amid concerns that the world\'s largest handset maker may struggle to pull off a turnaround quickly enough.',1306956484,''),(188,1,'BofA: No Need to Raise Capital','http://online.wsj.com/article/SB10001424052702303745304576359233352065322.html?mod=rss_whats_news_us','','Bank of America CEO Brian Moynihan adamantly denied the bank had any need to raise more capital as it continues to battle problems with mortgage investors and as it looks to raise its dividend.',1306944588,''),(189,1,'Macy\'s Sales Growing','http://online.wsj.com/article/SB10001424052702303657404576359361837222584.html?mod=rss_whats_news_us','','Macy\'s same-store sales for May jumped a robust 7.4% and the department store operator raised its sales targets for the quarter and year.',1306941325,''),(190,1,'Turnaround Firms Go Municipal','http://online.wsj.com/article/SB10001424052702303745304576359411542261574.html?mod=rss_whats_news_us','','Well known for their involvement in corporate restructurings, turnaround firms like FTI Consulting and Alvarez & Marsal are seeing increased opportunities to help distressed state and local governments.',1306952106,''),(191,1,'Liberty Begins Examining Barnes & Noble\'s Books','http://online.wsj.com/article/SB10001424052702303657404576359770745901328.html?mod=rss_whats_news_us','','Liberty Media is conducting due diligence at Barnes & Noble, looking closely at its books as it moves ahead with its bid for the company.',1306960198,''),(192,1,'Alpha Closes Massey Deal','http://online.wsj.com/article/SB10001424052702303657404576359403792812970.html?mod=rss_whats_news_us','','Alpha completed its $7.1 billion acquisition of Massey Energy, inheriting extensive reserves of high-demand coal and more than a dozen lawsuits stemming from a deadly accident last year.',1306955283,''),(193,1,'Prosecutor: Goffer Led Insider Network','http://online.wsj.com/article/SB10001424052702304563104576359653766793500.html?mod=rss_whats_news_us','','Former trader Zvi Goffer was the \"ringleader\" of an insider-trading network, a prosecutor said Wednesday, paying nearly $100,000 in exchange for confidential information about proposed mergers involving clients of law firm Ropes & Gray.',1306958026,''),(194,1,'Microsoft to Limit Windows Tablets','http://online.wsj.com/article/SB10001424052702303657404576359361464040304.html?mod=rss_whats_news_us','','Microsoft plans to restrict the number of computer hardware makers that initially can make tablets using its Windows operating system, requiring five select chip makers to pair up with one development partner each.',1306958626,''),(195,1,'Europe\'s Stress Tests Delayed','http://online.wsj.com/article/SB10001424052702303657404576359294265720556.html?mod=rss_whats_news_us','','The results of Europe\'s latest round of bank \"stress tests\" will be delayed until July as European regulators worry that banks and their national supervisors submitted overly optimistic data.',1306955266,''),(196,1,'Officials Work on New Greek Aid','http://online.wsj.com/article/SB10001424052702304563104576359510587233034.html?mod=rss_whats_news_us','','European finance officials met late Wednesday to prepare a fresh aid package for Greece, but the talks must first bridge a crucial gap between Germany and the ECB on how to prop up the indebted nation.',1306958347,''),(197,1,'U.S. May Lose $14 Billion on Auto Bailout','http://online.wsj.com/article/SB10001424052702303745304576359530678869402.html?mod=rss_whats_news_us','','The White House said taxpayers may never recover about $14 billion of the bailout money extended to the auto industry in 2008 and 2009.',1306956359,''),(198,1,'May Data Indicate Economic Slowdown','http://online.wsj.com/article/SB10001424052702303657404576359122470523138.html?mod=rss_whats_news_us','','The U.S. factory sector slowed sharply in May, ISM data showed. Meanwhile, private businesses added 38,000 jobs in May, ADP reported, as large companies cut workers.',1306955135,''),(199,2,'Li Will Face Sharapova in Semifinals','http://www.nytimes.com/2011/06/02/sports/li-will-face-sharapova-in-the-2011-french-open-semifinals.html?partner=rss&emc=rss','By CHRISTOPHER CLAREY','Li Na and Maria Sharapova advanced with straight-set victories in the quarterfinals of the French Open and will meet on Thursday.',1306958174,'http://www.nytimes.com/2011/06/02/sports/li-will-face-sharapova-in-the-2011-french-open-semifinals.html'),(200,2,'Nadal Returns to Form With Rout of Soderling','http://www.nytimes.com/2011/06/02/sports/2011-french-open-nadal-returns-to-form-with-rout-of-soderling.html?partner=rss&emc=rss','By CHRISTOPHER CLAREY','Rafael Nadal beat Robin Soderling in straight sets to reach the semifinals, where he will meet Andy Murray.',1306958548,'http://www.nytimes.com/2011/06/02/sports/2011-french-open-nadal-returns-to-form-with-rout-of-soderling.html'),(201,2,'In Fragile Tunisia, Central Bank Chief Sees a Halting Recovery','http://www.nytimes.com/2011/06/02/business/global/02tunisia.html?partner=rss&emc=rss','By MATTHEW SALTMARSH','Mustapha Kamel Nabli said the economic recovery in Tunisia will be slow and patchy because of the lingering effects of its recent social upheaval and the conflict in Libya.',1306956282,'http://www.nytimes.com/2011/06/02/business/global/02tunisia.html'),(202,2,'Abroad: For Kurds in Turkey, Autonomy in Music','http://www.nytimes.com/2011/06/05/arts/turkeys-kurds-slowly-build-cultural-autonomy.html?partner=rss&emc=rss','By MICHAEL KIMMELMAN','Bolstered by the Arab Spring and coming elections, Kurds in Turkey are pressing longstanding claims for broader parliamentary representation and more cultural freedoms.',1306959649,'http://www.nytimes.com/2011/06/05/arts/turkeys-kurds-slowly-build-cultural-autonomy.html'),(203,2,'Holocaust Survivors Again Seek Insurance Claims','http://www.nytimes.com/2011/06/02/us/02holocaust.html?partner=rss&emc=rss','By ERIC LICHTBLAU','The State Department says that the claims could undermine a reparations agreement, but there is a new push in Congress on behalf of the survivors.',1306948825,'http://www.nytimes.com/2011/06/02/us/02holocaust.html'),(204,2,'French Socialists May Expel Member Speaking Out on Strauss-Kahn','http://www.nytimes.com/2011/06/02/world/europe/02france.html?partner=rss&emc=rss','By MAÏA de la BAUME','Anne Mansouret, a prominent member of the party who originally dissuaded her daughter from filing a complaint against Dominique Strauss-Kahn in 2002, is now talking about the incident.',1306954024,'http://www.nytimes.com/2011/06/02/world/europe/02france.html'),(205,2,'Stocks Plummet on Disappointing Economic Reports','http://www.nytimes.com/2011/06/02/business/02markets.html?partner=rss&emc=rss','By CHRISTINE HAUSER','Major indexes fell more than 2 percent after reports of slow job creation and manufacturing.',1306959441,'http://www.nytimes.com/2011/06/02/business/02markets.html'),(206,2,'Germany E. Coli Outbreak Involves Rare, Deadly Strain','http://www.nytimes.com/2011/06/02/world/europe/02ecoli.html?partner=rss&emc=rss','By JUDY DEMPSEY and JAMES KANTER','The health authorities are struggling to identify the source of an outbreak that has killed at least 15 people.',1306959441,'http://www.nytimes.com/2011/06/02/world/europe/02ecoli.html'),(207,1,'States See Uptick in Revenue, Costs','http://online.wsj.com/article/SB10001424052702303657404576359742730690416.html?mod=rss_whats_news_us','','State budgets are improving but remain burdened by weak tax revenue and the growing cost of entitlement programs such as Medicaid, according to a report to be released Thursday by the National Governors Association and the National Association of State Budget Officers.',1307008267,''),(208,1,'American Must Return to Orbitz','http://online.wsj.com/article/SB10001424052702303657404576359973714793078.html?mod=rss_whats_news_us','','AMR\'s American Airlines must make its flights available on Orbitz Worldwide\'s websites, an Illinois court ruled.',1306980038,''),(209,1,'Delta Probed on Union Drive','http://online.wsj.com/article/SB10001424052702303657404576359733642573722.html?mod=rss_whats_news_us','','Delta Air Lines faces further scrutiny by the U.S. over a union\'s allegations the carrier interfered with an organizing drive there last year.',1307008221,''),(210,1,'PlayStation Network Returning Thursday, Mostly','http://online.wsj.com/article/SB10001424052702303745304576360600194267020.html?mod=rss_whats_news_us','','Sony said its PlayStation Network online gaming service, shut down after hacker attacks, will be fully restored world-wide Thursday except in Japan, Hong Kong and South Korea, where the company is still in talks with local authorities.',1306997367,''),(211,1,'Chinese Banks Build Yuan Deposit Hoard in Hong Kong','http://online.wsj.com/article/SB10001424052702304563104576360693567639406.html?mod=rss_whats_news_us','','Chinese banks are racing to build up their yuan deposit base in Hong Kong by tapping its flourishing debt market, as they expect a potential rise in demand outside the country\'s borders for loans denominated in China\'s currency.',1307007166,''),(212,1,'Starbucks Tightens Focus on Mainland China Market','http://online.wsj.com/article/SB10001424052702304563104576360850211561700.html?mod=rss_whats_news_us','','Starbucks signed a deal with its Chinese joint-venture partner to give the U.S. coffee company full ownership of Starbucks outlets in six Chinese , in a move to gain control of its operations there.',1307014269,''),(213,1,'Hyundai Soars as Auto Sales Slip','http://online.wsj.com/article/SB10001424052702303745304576359354063751720.html?mod=rss_whats_news_us','','The U.S. auto industry suffered its first significant setback in more than 18 months as new car and truck sales declined 3.7% in May, hurt by higher prices, Japanese supply shortages and growing consumer jitters about the economy.',1307008392,''),(214,1,'Spain Passes Key Market Test','http://online.wsj.com/article/SB10001424052702303745304576361022087185358.html?mod=rss_whats_news_us','','Spain passed a key test of investor confidence, selling $5.67 billion in short-term government bonds—almost the maximum targeted—despite continuing worries about the risk of contagion from the financial turmoil in Greece.',1307012704,''),(215,1,'Treasurys Roar Ahead','http://online.wsj.com/article/SB10001424052702303745304576359160581579624.html?mod=rss_whats_news_us','','The run in Treasurys, defying conventional wisdom, hit a new milestone on Wednesday with the 10-year note\'s yield falling below 3% for the first time this year.',1307009418,''),(216,1,'Hon Hai Says Halted Workshops Resume','http://online.wsj.com/article/SB10001424052702303657404576361010698304464.html?mod=rss_whats_news_us','','Hon Hai Precision Industry said its polishing workshops in China went back online this week after a probe into a combustible dust explosion that killed three and injured 15 workers last month.',1307013562,''),(217,1,'Citi Again Drains UBS Talent Pool','http://online.wsj.com/article/SB10001424052702304563104576359743646600906.html?mod=rss_whats_news_us','','The hires are the latest attempt by the financial-services firm to restore its investment bank and boost its lackluster standing in industry rankings.',1307008850,''),(218,1,'\'Energy Shots\' Find New Market in Seniors','http://online.wsj.com/article/SB10001424052748704322804576303452592018100.html?mod=rss_whats_news_us','','Originally marketed to young people, small shots of caffeinated vitamin drinks such as 5-Hour Energy are appealing to a growing number of people over 60 who aren\'t ready to slow down with age.',1307012875,''),(219,1,'U.S. Is Tight-Lipped on IMF Candidates','http://online.wsj.com/article/SB10001424052702304563104576359741165106166.html?mod=rss_whats_news_us','','The U.S. is largely staying silent in the battle to pick the next chief of the International Monetary Fund, a move that some observers see as a tactic designed to let key pieces of the race fall into place without heavy-handed U.S. involvement.',1307013384,''),(220,1,'Bidder Emerges for Borders Shops','http://online.wsj.com/article/SB10001424052702303657404576359981109670642.html?mod=rss_whats_news_us','','Private-equity firm Gores Group is in talks to buy more than half of Borders Group\'s stores out of bankruptcy.',1307016380,''),(221,1,'Trichet Seeks Tougher Debt Measures','http://online.wsj.com/article/SB10001424052702303745304576360961826796994.html?mod=rss_whats_news_us','','ECB President Jean-Claude Trichet called for much tougher fiscal intervention within the euro zone and suggested the creation of a euro-zone finance ministry, a proposal that comes as a number of the bloc\'s member states struggle with debt crises.',1307017096,''),(222,1,'Mining Boom Fuels New Mongol Hoard','http://online.wsj.com/article/SB10001424052748703421204576331144234070656.html?mod=rss_whats_news_us','','A bold experiment aimed at turning an entire nation into stock investors is getting under way in a remote corner of the financial system: Mongolia.',1307008158,''),(223,1,'Stock Futures Await Jobs Data','http://online.wsj.com/article/SB10001424052702303745304576360973225781228.html?mod=rss_whats_news_us','','U.S. stock futures edged slightly higher after weak data sent shares tumbling in the previous session, with figures on jobless claims and sales updates from a slew of retailers likely to set the tone for the day.',1307016660,''),(224,1,'Google: China Hacked Email','http://online.wsj.com/article/SB10001424052702303657404576359770243517568.html?mod=rss_whats_news_us','','Google said Chinese hackers targeted the Gmail accounts of senior U.S. officials and hundreds of other prominent people in a fresh attack certain to intensify Internet security concerns.',1307014052,''),(225,2,'At Least 27 Pakistani Troops Killed in Border Fight, Officials Say','http://www.nytimes.com/2011/06/03/world/asia/03pakistan.html?partner=rss&emc=rss','By SALMAN MASOOD','At least 27 Pakistani troops have been killed as a battle with militants who crossed the border from Afghanistan into northwestern Pakistan entered its second day on Thursday.',1307015853,'http://www.nytimes.com/2011/06/03/world/asia/03pakistan.html'),(226,2,'Memo From Berlin: Germans’ Deep Suspicions of Nuclear Power Reach a Political Tipping Point','http://www.nytimes.com/2011/06/02/world/europe/02germany.html?partner=rss&emc=rss','By ALAN COWELL','Two intertwined phenomena — electoral maneuvering and longstanding angst about nuclear power — led to Chancellor Angela Merkel’s ordering that nuclear plants be phased out.',1307003420,'http://www.nytimes.com/2011/06/02/world/europe/02germany.html'),(227,2,'Open Border at Gaza Is Not So Open, Palestinians Find','http://www.nytimes.com/2011/06/02/world/middleeast/02gaza.html?partner=rss&emc=rss','By FARES AKRAM','Days after Egypt opened its border with Gaza, new restrictions have been imposed on Palestinians who want to cross, and the area’s Hamas rulers spoke on Wednesday with frustration and anger.',1306991438,'http://www.nytimes.com/2011/06/02/world/middleeast/02gaza.html'),(228,2,'World Health Organization Says Virulent E. Coli Strain Was Previously Unknown','http://www.nytimes.com/2011/06/03/world/europe/03ecoli.html?partner=rss&emc=rss','By ALAN COWELL and WILLIAM NEUMAN','The strain, which a World Health Organization official called unique in news reports on Thursday, has sickened 1,500 people in Germany, and killed at least 16.',1307014857,'http://www.nytimes.com/2011/06/03/world/europe/03ecoli.html'),(229,2,'Dispute Grows as Egyptian Gas Is Still Not Flowing to Israel','http://www.nytimes.com/2011/06/02/world/middleeast/02egyptgas.html?partner=rss&emc=rss','By ETHAN BRONNER','A damaged Egyptian pipeline that supplies natural gas to Israel has been repaired, but the gas is not flowing so foreign shareholders are threatening legal action.',1307007633,'http://www.nytimes.com/2011/06/02/world/middleeast/02egyptgas.html'),(230,2,'China Extends Hand and Fist to Protesters','http://www.nytimes.com/2011/06/02/world/asia/02mongolia.html?partner=rss&emc=rss','By ANDREW JACOBS','Authorities in Inner Mongolia have sought to stanch protests through a classically Chinese carrot-and-stick approach to ethnic instability.',1307007476,'http://www.nytimes.com/2011/06/02/world/asia/02mongolia.html'),(231,2,'Gates Talks of Boosting Asian Security Despite Budget Cuts','http://www.nytimes.com/2011/06/03/world/asia/03Gates.html?partner=rss&emc=rss','By THOM SHANKER','Faced with significantly reduced military spending, the United States should pursue cooperation with Asian allies to defend regional security, Defense Secretary Robert M. Gates said Thursday.',1307010025,'http://www.nytimes.com/2011/06/03/world/asia/03Gates.html'),(232,2,'Stocks in Europe and Asia Follow Wall Street Down','http://www.nytimes.com/2011/06/03/business/global/03iht-markets.html?partner=rss&emc=rss','By DAVID JOLLY and BETTINA WASSENER','Stocks fell in Europe and Asia as investors took in the growing signs that the pace of recovery in the United States and elsewhere may be slowing down.',1307007696,'http://www.nytimes.com/2011/06/03/business/global/03iht-markets.html'),(233,2,'Japan Prime Minister Survives No-Confidence Vote','http://www.nytimes.com/2011/06/03/world/asia/03japan.html?partner=rss&emc=rss','By MARTIN FACKLER','Prime Minister Naoto Kan survived a no-confidence vote in Parliamentm but only after promising to resign once recovery from recent natural disasters gets underway.',1307008803,'http://www.nytimes.com/2011/06/03/world/asia/03japan.html'),(234,2,'Fighting Spreads in Yemen, Raising Fear of Civil War','http://www.nytimes.com/2011/06/03/world/middleeast/03yemen.html?partner=rss&emc=rss','By NASSER ARRABYEE and ROBERT F. WORTH','Government troops waged increa