ring.',1307039431,''),(245,1,'CME Targets NYSE Business','http://online.wsj.com/article/SB10001424052702303745304576361193129934716.html?mod=rss_whats_news_us','','CME Group laid out plans to launch a new slate of European-flavored interest-rate contracts, escalating a battle with NYSE Euronext over one of the world\'s most heavily traded derivatives markets.',1307039463,''),(246,1,'New York Times Names Abramson Top Editor','http://online.wsj.com/article/SB10001424052702303657404576361342892480796.html?mod=rss_whats_news_us','','The New York Times named managing editor Jill Abramson to succeed Bill Keller as executive editor.',1307036951,''),(247,1,'Borders Given More Time','http://online.wsj.com/article/SB10001424052702303657404576361440464668446.html?mod=rss_whats_news_us','','A judge gave Borders Group more time to control its bankruptcy case, as the bookseller argued that it is close to a deal to sell most or all of its stores',1307036797,''),(248,1,'Reinsurers Reconsider Rates in Florida','http://online.wsj.com/article/SB10001424052702303745304576361311924438204.html?mod=rss_whats_news_us','','The price reinsurers charge for disaster protection in Florida has suddenly become wildly variable, a result of a shift in how the industry measures potential hurricane losses and a long roster of recent natural catastrophes.',1307040979,''),(249,1,'Continental, US Airways Are Fined','http://online.wsj.com/article/SB10001424052702303657404576361662241658484.html?mod=rss_whats_news_us','','The Transportation Department fined Continental Airlines $120,000 and US Airways $45,000 for violating rules barring deceptive price advertising.',1307042243,''),(250,1,'Madoff Employee to Plead Guilty','http://online.wsj.com/article/SB10001424052702304563104576361601780805740.html?mod=rss_whats_news_us','','A former employee of convicted Ponzi schemer Bernard Madoff, Eric S. Lipkin, is expected to plead guilty to criminal charges on Monday, according to a court document.',1307042185,''),(251,1,'Jobless Claims Remain Elevated','http://online.wsj.com/article/SB10001424052702303657404576361151258620110.html?mod=rss_whats_news_us','','Initial unemployment claims fell by 6,000 in the latest week but remain elevated, a sign of the persistent weakness of the economy.',1307032040,''),(252,1,'Big Banks on Downgrade Watch','http://online.wsj.com/article/SB10001424052702304563104576361353111885360.html?mod=rss_whats_news_us','','Moody\'s placed the debt ratings of Bank of America, Citigroup and Wells Fargo on review for possible downgrade.',1307045344,''),(253,1,'Retailers Post Mixed May Sales','http://online.wsj.com/article/SB10001424052702303657404576361172668424398.html?mod=rss_whats_news_us','','Consumers went shopping in May, but high gasoline prices and an uncertain economy weighed on how much they spent. Target and Gap missed expectations, while Costco\'s and Sak\'s sales jumped.',1307041824,''),(254,2,'Movie Review | \'X-Men: First Class\': Mutants Go Back to Where It All Began','http://movies.nytimes.com/2011/06/03/movies/x-men-first-class-review.html?partner=rss&emc=rss','By MANOHLA DARGIS','This latest installment of the “X-Men” series reaches back to the early 1960s for an origin story of mutants.',1307041999,'http://movies.nytimes.com/2011/06/03/movies/x-men-first-class-review.html'),(255,2,'Abramson to Replace Keller as The Times’s Executive Editor','http://www.nytimes.com/2011/06/03/business/media/03paper.html?partner=rss&emc=rss','By JEREMY W. PETERS','The New York Times announced that Jill Abramson, a managing editor, will succeed Bill Keller, who is stepping down to become a full-time writer.',1307043632,'http://www.nytimes.com/2011/06/03/business/media/03paper.html'),(256,2,'F.B.I. to Investigate Gmail Attacks Said to Come From China','http://www.nytimes.com/2011/06/03/technology/03google.html?partner=rss&emc=rss','By JOHN MARKOFF and DAVID BARBOZA','Secretary of State Hillary Rodham Clinton called the allegations about the breach of Google’s e-mail service “very serious.”',1307042539,'http://www.nytimes.com/2011/06/03/technology/03google.html'),(257,2,'The Caucus: Declaring Run, Romney Says Obama Failed','http://thecaucus.blogs.nytimes.com/2011/06/02/romney-to-announce-candidacy-in-n-h/?partner=rss&emc=rss','By MICHAEL D. SHEAR','Mitt Romney presented himself as a turnaround expert for the country as he formally began his campaign.',1307041390,'http://thecaucus.blogs.nytimes.com/2011/06/02/romney-to-announce-candidacy-in-n-h/'),(258,2,'Straight Sets: Schiavone Returns to French Open Final','http://straightsets.blogs.nytimes.com/2011/06/02/live-now-analysis-of-schiavone-bartoli-semifinal/?partner=rss&emc=rss','By JOHN MARTIN and GEOFF MACDONALD','Francesca Schiavone defeated Marion Bartoli, 6-3, 6-3, on Thursday afternoon to return to the final of the French Open.',1307032530,'http://straightsets.blogs.nytimes.com/2011/06/02/live-now-analysis-of-schiavone-bartoli-semifinal/'),(259,2,'More Than 200 Migrants Missing in Mediterranean After Boat Capsizes','http://www.nytimes.com/2011/06/03/world/europe/03refugees.html?partner=rss&emc=rss','By SCOTT SAYARE and J. DAVID GOODMAN','At least 200 migrants seeking to cross from Libya into Europe were missing Thursday after having fallen out of their capsized vessel during a rescue operation off the coast of Tunisia.',1307045049,'http://www.nytimes.com/2011/06/03/world/europe/03refugees.html'),(260,2,'DealBook: Goldman Said to Receive Subpoena Over Financial Crisis','http://dealbook.nytimes.com/2011/06/02/goldman-receives-subpoena-over-financial-crisis/?partner=rss&emc=rss','By ANDREW ROSS SORKIN and SUSANNE CRAIG','An inquiry by the Manhattan district attorney’s office is linked to a Senate panel report that found that the firm had “misled” its clients.',1307033899,'http://dealbook.nytimes.com/2011/06/02/goldman-receives-subpoena-over-financial-crisis/'),(261,2,'DealBook: Groupon Files to Go Public','http://dealbook.nytimes.com/2011/06/02/groupon-files-to-go-public/?partner=rss&emc=rss','By EVELYN M. RUSLI and MICHAEL J. DE LA MERCED','The social buying site Groupon filed to go public, with plans to raise an estimated $750 million.',1307044813,'http://dealbook.nytimes.com/2011/06/02/groupon-files-to-go-public/'),(262,2,'Trichet Calls for E.U. Finance Ministry to Curb Future Crises','http://www.nytimes.com/2011/06/03/business/global/03euro.html?partner=rss&emc=rss','By JACK EWING and NIKI KITSANTONIS','As financial officials meet to consider new aid for Greece, the president of the European Central Bank urged \"bold\" action to change in the way the euro area is governed.',1307037308,'http://www.nytimes.com/2011/06/03/business/global/03euro.html'),(263,1,'Facebook: Ceglia Emails Are Forged','http://online.wsj.com/article/SB10001424052702303657404576361821090794638.html?mod=rss_whats_news_us','','Facebook fought back in court against a man who claims he is entitled to a large stake in the social-networking company, saying the documents at the heart of the case are an \"amateurish forgery.\"',1307064031,''),(264,1,'NBC Hires Former NPR CEO Schiller','http://online.wsj.com/article/SB10001424052702303657404576361862493308974.html?mod=rss_whats_news_us','','NBC News said Thursday that it had hired Vivian Schiller, who quit as chief executive of NPR in March, to a new role overseeing the news unit\'s digital strategy.',1307093806,''),(265,1,'WaMu Wins Retiree-Savings Fight','http://online.wsj.com/article/SB10001424052702303745304576361792294618586.html?mod=rss_whats_news_us','','Washington Mutual, the former parent of the thrift that went under in the largest banking collapse in U.S. history, has won a court fight to hang on to $69 million in retirement savings of Home Savings of America employees.',1307047070,''),(266,1,'Pearson to Use Brazil as Education Template','http://online.wsj.com/article/SB10001424052702303745304576362933781939742.html?mod=rss_whats_news_us','','Pearson is looking to use its recently enlarged education 