od=rss_whats_news_us','','Ebay\'s PayPal said it would stop providing electronic payment services for AliExpress, an online sales platform operated by Alibaba, apparently ending a rapprochement between the e-commerce rivals.',1307099689,''),(273,1,'SEC Probes China Auditors','http://online.wsj.com/article/SB10001424052702304563104576361422372121248.html?mod=rss_whats_news_us','','The SEC is investigating some accounting firms over their audits of Chinese companies whose shares trade in the U.S., and the inquiry is expected to lead to enforcement cases, people familiar with the situation said.',1307094171,''),(274,1,'Fiat, U.S. Set Chrysler Deal','http://online.wsj.com/article/SB10001424052702303657404576361602093516370.html?mod=rss_whats_news_us','','Fiat has an agreement to buy the U.S. Treasury\'s remaining 6% stake in Chrysler, putting itself in a position to acquire most or all of the company\'s shares held by others.',1307093885,''),(275,1,'Probe Deepens of Alleged Inside Trades at FDA','http://online.wsj.com/article/SB10001424052702304563104576361683671502282.html?mod=rss_whats_news_us','','A federal probe into insider trading at the FDA, which has focused on an agency chemist, is expanding to look at other government employees.',1307094136,''),(276,1,'Groupon to Gauge IPO Mania','http://online.wsj.com/article/SB10001424052702303745304576361631817311972.html?mod=rss_whats_news_us','','Groupon filed to go public in a deal that could value the e-commerce company at as much as $20 billion, a hotly anticipated offering that could test the strength of a tech-investing frenzy.',1307095326,''),(277,1,'Moody\'s Threatens U.S. Debt Rating Cut','http://online.wsj.com/article/SB10001424052702303745304576361931297371002.html?mod=rss_whats_news_us','','Moody\'s warned it might review the government\'s Aaa debt rating for a possible downgrade as early as next month if there is no progress toward a deal on the federal borrowing limit.',1307103291,''),(278,1,'Gmail Hack Targeted White House','http://online.wsj.com/article/SB10001424052702304563104576361863723857124.html?mod=rss_whats_news_us','','People who work at the White House were among those targeted by the China-based hackers who broke into Google\'s Gmail accounts.',1307075210,''),(279,1,'Jobless Rate Merits Close Scrutiny','http://online.wsj.com/article/SB10001424052702304563104576361813314427824.html?mod=rss_whats_news_us','','Ahead of the Tape:',1307102133,''),(280,1,'Syria Violence Tests U.S.','http://online.wsj.com/article/SB10001424052702304563104576361812070303934.html?mod=rss_whats_news_us','','Forces loyal to Assad pressed a sustained assault against protesters in one of the bloodiest episodes in the so-called Arab Spring, exposing the quandary that Obama faces in dealing with a man he once thought could be an ally.',1307101809,''),(281,2,'Li Is First Chinese Woman in French Final','http://www.nytimes.com/2011/06/03/sports/tennis/2011-french-open-li-to-meet-schiavone-in-final.html?partner=rss&emc=rss','By CHRISTOPHER CLAREY','Li Na beat Maria Sharapova, 6-4, 7-5, to become the first Chinese woman to advance to a final at Roland Garros.',1307083814,'http://www.nytimes.com/2011/06/03/sports/tennis/2011-french-open-li-to-meet-schiavone-in-final.html'),(282,2,'Three Gorges Dam Is Said to Hurt Areas Downstream','http://www.nytimes.com/2011/06/03/world/asia/03china.html?partner=rss&emc=rss','By EDWARD WONG','The dam’s planners failed to properly gauge its effects on lakes and other bodies of water downstream, especially during the drought conditions that are now ravaging the area, an official said.',1307094605,'http://www.nytimes.com/2011/06/03/world/asia/03china.html'),(283,2,'E-Mail Fraud Hides Behind Friendly Face','http://www.nytimes.com/2011/06/03/technology/03hack.html?partner=rss&emc=rss','By MATT RICHTEL and VERNE G. KOPYTOFF','The Gmail attacks Google disclosed used a rapidly proliferating form of e-mail fraud called spear phishing to steal passwords and monitor accounts.',1307077819,'http://www.nytimes.com/2011/06/03/technology/03hack.html'),(284,2,'Rome Journal: Bowlers and Batsmen Signal a Demographic Shift in an Eternal City','http://www.nytimes.com/2011/06/03/world/europe/03rome.html?partner=rss&emc=rss','By RACHEL DONADIO','A game popular in England and countries once part of its empire spreads farther as South Asian immigrants settle in Italy.',1307100321,'http://www.nytimes.com/2011/06/03/world/europe/03rome.html'),(285,2,'Mladic Refuses to Enter Plea at War Crimes Tribunal','http://www.nytimes.com/2011/06/04/world/europe/04hague.html?partner=rss&emc=rss','By MARLISE SIMONS and DAVID JOLLY','Ratko Mladic, the former Serbian general accused of genocide in the Balkan conflict, on Friday made his first appearance before a U.N. tribunal to face charges of war crimes.',1307102475,'http://www.nytimes.com/2011/06/04/world/europe/04hague.html'),(286,2,'Legal Outsourcing Firms Creating Jobs for American Lawyers','http://www.nytimes.com/2011/06/03/business/03reverse.html?partner=rss&emc=rss','By HEATHER TIMMONS','Companies that added to the financial woes of the American legal profession by sending work to low-cost countries are now creating jobs for lawyers in the United States.',1307079782,'http://www.nytimes.com/2011/06/03/business/03reverse.html'),(287,2,'Magazine Preview: Watching the Murder of an Innocent Man','http://www.nytimes.com/2011/06/05/magazine/watching-the-murder-of-an-innocent-man.html?partner=rss&emc=rss','By BARRY BEARAK','In a shantytown near Johannesburg, an angry mob committed a horrifying crime that was caught on video.',1307076229,'http://www.nytimes.com/2011/06/05/magazine/watching-the-murder-of-an-innocent-man.html'),(288,2,'U.S. Calls Antibiotics Wrong Step on E. Coli','http://www.nytimes.com/2011/06/03/health/03treatment.html?partner=rss&emc=rss','By GARDINER HARRIS','Officials in the United States suggest that the Europeans are not looking in the right direction to fight the outbreak.',1307103095,'http://www.nytimes.com/2011/06/03/health/03treatment.html'),(289,1,'Prada Discloses Pay, Tax Details in Hong Kong','http://online.wsj.com/article/SB10001424052702303657404576363172257124438.html?mod=rss_whats_news_us','','Prada matriarch Miuccia Prada and her husband received nearly $29 million in compensation in the fashion house\'s last fiscal year, according to documents filed in Hong Kong ahead of its planned $2 billion initial public offering.',1307104950,''),(290,1,'UBS London Plans Dealt Blow','http://online.wsj.com/article/SB10001424052702303745304576363430503168942.html?mod=rss_whats_news_us','','Plans to develop a new U.K. headquarters in London\'s financial district for  UBS were dealt a blow when an architectural watchdog recommended the existing site for protected status.',1307117841,''),(291,1,'Foster\'s Says It Is Aware of Buyout Talk','http://online.wsj.com/article/SB10001424052702303657404576363133418837012.html?mod=rss_whats_news_us','','Australian brewing giant Foster\'s Group Ltd. said Friday it had nothing to disclose in regard to a potential buyout of the brewer after media reports indicated bidders were beginning to circle.',1307104361,''),(292,1,'Pilots Union Seeks Vote at JetBlue','http://online.wsj.com/article/SB10001424052702303657404576363440827111376.html?mod=rss_whats_news_us','','The Air Line Pilots Association has formally asked the National Mediation Board to schedule an election that would give 2,300 nonunion JetBlue pilots the chance to join the union.',1307121242,''),(293,1,'Corporate Debt Takes Hit, but June Swoon Isn\'t Likely','http://online.wsj.com/article/SB10001424052702304563104576363593198759436.html?mod=rss_whats_news_us','','Corporate-bond prices sank but market participants said companies would likely shrug off economic concerns while borrowing rates remain near historic lows.',1307135783,''),(294,1,'Massey Disputes Mine-Blast Reports','http://online.wsj.com/article/SB10001424052702303657404576363280983224762.html?mod=rss_whats_news_us','','Massey Energy\'s investigation into a mine explosion that killed 29 workers says the blast was fueled by a natural-gas surge and not coal dust, contradicting the findings of federal regulators and an independent probe.',1307141364,''),(295,1,'Greece Set to Get Next Aid Installment','http://online.wsj.com/article/SB10001424052702303657404576362871746111938.html?mod=rss_whats_news_us','','A top euro-zone official said cash-strapped Greece is in line for a fresh program of aid from its peers in the currency union, and EU and IMF authorities said Athens would likely get in July the next tranche of money from last year\'s €110 billion ($158 billion) bailout.',1307137967,''),(296,1,'ABC Hopes Couric Can Replace \'Oprah\'','http://online.wsj.com/article/SB10001424052702303745304576363732963344302.html?mod=rss_whats_news_us','','Katie Couric is finalizing a deal with Walt Disney\'s ABC to create her own syndicated talk show, and is likely to announce the program as early as Monday.',1307142717,''),(297,1,'Financial Firms Face Stricter Capital Rules','http://online.wsj.com/article/SB10001424052702303657404576363482173819822.html?mod=rss_whats_news_us','','Fed Board Gov. Tarullo said U.S. regulators should set additional capital requirements for financial firms. One plan goes about 20% to more than 100% over Basel III.',1307142169,''),(298,1,'Ford, Mazda in Talks to Dissolve U.S. Venture','http://online.wsj.com/article/SB10001424052702303745304576362663235179704.html?mod=rss_whats_news_us','','Ford and Mazda are in talks to dissolve a joint production venture in Michigan, where the Mazda 6 and Ford Mustang are made, as sluggish sales have the plant operating at less than half capacity.',1307141253,''),(299,1,'Chrysler May Not Pursue IPO','http://online.wsj.com/article/SB10001424052702303657404576363703617317630.html?mod=rss_whats_news_us','','Chrysler for the first time Friday confirmed an IPO won\'t be pursued if its major shareholder, Fiat, reaches deals 