ent','http://www.nytimes.com/2011/06/04/world/middleeast/04mossad.html?partner=rss&emc=rss','By ETHAN BRONNER','Meir Dagan said that with recent retirements, including his own, “there is no one to stop” the prime minister and defense chief from making rash decisions.',1307119477,'http://www.nytimes.com/2011/06/04/world/middleeast/04mossad.html'),(306,2,'Hiring in U.S. Slowed in May With 54,000 Jobs Added','http://www.nytimes.com/2011/06/04/business/economy/04jobs.html?partner=rss&emc=rss','By CATHERINE RAMPELL','The unemployment rate rose to 9.1 percent, raising concerns once again about the underlying strength of the economic recovery.',1307139544,'http://www.nytimes.com/2011/06/04/business/economy/04jobs.html'),(307,2,'Nadal and Federer to Meet in Final','http://www.nytimes.com/2011/06/04/sports/tennis/2011-french-open-its-nadal-federer-in-the-final.html?partner=rss&emc=rss','By CHRISTOPHER CLAREY','Rafael Nadal beat Andy Murray in straight sets, setting up a matchup with Roger Federer, who put an end to Novak Djokovic’s streak of 43 straight victories.',1307139547,'http://www.nytimes.com/2011/06/04/sports/tennis/2011-french-open-its-nadal-federer-in-the-final.html'),(308,2,'Formula One: FIA Reinstates Bahrain Grand Prix','http://formulaone.blogs.nytimes.com/2011/06/03/fia-reinstates-bahrain-grand-prix/?partner=rss&emc=rss','By BRAD SPURGEON','The Bahrain Grand Prix will go forth, after the World Council of the International Automobile Federation voted Friday to reinstate it.',1307121257,'http://formulaone.blogs.nytimes.com/2011/06/03/fia-reinstates-bahrain-grand-prix/'),(309,2,'At War: History Repeats for a Correspondent in Tripoli','http://atwar.blogs.nytimes.com/2011/06/03/history-repeats-for-a-correspondent-in-tripoli/?partner=rss&emc=rss','By JOHN F. BURNS','For the second time in eight years, a reporter finds himself living under a nightly fusillade of bombs and missiles.',1307128203,'http://atwar.blogs.nytimes.com/2011/06/03/history-repeats-for-a-correspondent-in-tripoli/'),(310,2,'House Rebukes Obama Over Libya','http://www.nytimes.com/2011/06/04/world/africa/04policy.html?partner=rss&emc=rss','By JENNIFER STEINHAUER','The resolution, which passed 268 to 145, has no practical effect, but it underscored the anger in Congress over being bypassed by the president.',1307139544,'http://www.nytimes.com/2011/06/04/world/africa/04policy.html'),(311,2,'Yemeni President Wounded in Palace Attack','http://www.nytimes.com/2011/06/04/world/middleeast/04yemen.html?partner=rss&emc=rss','By NASSER ARRABYEE and J. DAVID GOODMAN','It was the first time that President Ali Abdullah Saleh had been the target of an attack during months of political turmoil.',1307140500,'http://www.nytimes.com/2011/06/04/world/middleeast/04yemen.html'),(312,2,'Syrian Protesters Mass Again Despite Harsh Crackdown','http://www.nytimes.com/2011/06/04/world/middleeast/04syria.html?partner=rss&emc=rss','By LIAM STACK and KATHERINE ZOEPF','Large crowds turned out on Friday despite the shutdown of the country’s Internet. Dozens of deaths were reported in Hama.',1307141406,'http://www.nytimes.com/2011/06/04/world/middleeast/04syria.html');
