INSERT INTO `drupal_field_data_body` VALUES ('node','article',0,1,1,'und',0,'This web site is dedicated to the disemination of information relating to Condor the Competition Soaring Simulator','','filtered_html'),('node','page',0,2,2,'und',0,'This site is a repository for information related to Condor the Competition Soaring Simulator.','','filtered_html'),('node','article',0,3,3,'en',0,'<h1>Drupal Text Formats</h1>\r\nThere are three Drupal text formats as listed below.  Filtered HTML filters the text in certain ways that I have yet to learn about.  Full HTML, available to administrators only, allows the full range of HTML tags.  I assume that plain text is just what it says.\r\n<br>\r\n<ul>\r\n<li> Filtered HTML  -  Available for all users</li>\r\n<li> Full HTML  -  Available for administrators only</li>\r\n<li><i> Plain text</i>  -  Available for all users</li>\r\n</ul>\r\n','','full_html'),('node','gossip',0,7,8,'en',0,'Cheating is delicious!','','filtered_html'),('node','gossip',0,8,9,'en',0,'Anonymous users (not registered) can submit articles to the gossip column too.','','filtered_html'),('node','gossip',0,9,22,'en',0,'We hear that Puddie won an ASW27 in the Adrian Soaring Club annual raffal.  Do you believe it?','','plain_text'),('node','article',0,10,14,'en',0,'I am reading Beginning Drupal and doing the examples presented in the book.&nbsp; That last thing that I did was to install the wysiswyg module and then the &lt;strong&gt;openwysiwig&lt;/strong&gt; application which I copied to /sites/all/libraries.<br>','','full_html'),('node','article',0,11,15,'en',0,'<span style=\"font-weight: bold;\">This is bold</span> and this is not<br><br><ol><li>This is a numbered list.<br></li></ol>','','filtered_html'),('node','gossip',0,12,20,'en',0,'<font size=\"3\">Here is some sample text. <span style=\"font-weight: bold;\">Ouch!&nbsp; The font is so small, I can <font size=\"7\">barely</font> see it.</span></font><br>','','full_html'),('node','article',0,13,21,'en',0,'My favorite sushi is an avocado roll.&nbsp; The avocado must be very fresh with a beautiful green color.&nbsp; I don\'t like little cucumber shreds in it like they have been doing at City Market for a couple of years now.<br>','','filtered_html');
/*!40000 ALTER TABLE `drupal_field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

