INSERT INTO `drupal_field_data_comment_body` VALUES ('comment','comment_node_gossip',0,1,1,'und',0,'I really don\'t believe it!','filtered_html'),('comment','comment_node_gossip',0,2,2,'und',0,'No I don\'t believe it.  Show me the wings!','filtered_html'),('comment','comment_node_gossip',0,3,3,'und',0,'I don\'t believe that he won that glider.  I think that he is a liar!','filtered_html'),('comment','comment_node_gossip',0,4,4,'und',0,'That wasn\'t a very nice thing to say about my brother!','filtered_html'),('comment','comment_node_gossip',0,5,5,'und',0,'<font size=\"5\">As you can see, I can now change the <span style=\"font-style: italic;\">font--</span><span style=\"text-decoration: underline;\">as</span> well as doing other things like underlining!<br></font>','full_html'),('comment','comment_node_gossip',0,6,6,'und',0,'Hi, my name is Wuzzie, I Puddies twin brother.&nbsp; He did, in fact, win the MF glider in the raphyll.&nbsp;&nbsp; It up there right now, fighting with the tornados.&nbsp; Wuzzie<br>','filtered_html'),('comment','comment_node_gossip',0,7,7,'und',0,'Hi Tubby,<br><br>I sent a request a few times for a new passturd, but that email never comes through.&nbsp; Then I set up a new account using my gmail address and it says pending administration approval.&nbsp; Are you really going to be that selective.&nbsp; Shutting giant babies such as myself out?<br><br>I demand an in!&nbsp; Giant Wuzzie<br>','filtered_html'),('comment','comment_node_gossip',0,9,9,'und',0,'This is a test from Korpus<br>','filtered_html'),('comment','comment_node_gossip',0,10,10,'und',0,'TEST.&nbsp; Test.<br>','filtered_html');
