om.module:710','default','Protect @name','','none'),(252,'mollom.module:718','default','Server settings','','none'),(253,'mollom.module:724','default','Fallback strategy','','none'),(254,'mollom.module:728','default','Leave all forms unprotected and accept all submissions','','none'),(255,'mollom.module:736','default','Mollom access keys','','none'),(256,'mollom.module:743','default','Public key','','none'),(257,'mollom.module:745','default','The public key is used to uniquely identify you.','','none'),(258,'mollom.module:750','default','Private key','','none'),(259,'mollom.module:1005','default','The CAPTCHA field is required.','','none'),(260,'mollom.module:783,958,962,968,996,1000,1084,1145,1156,1159,1183,0','default','mollom','','none'),(261,'mollom.module:958','default','Ham: %message','','none'),(262,'mollom.module:962','default','Spam: %message','','none'),(263,'mollom.module:968','default','Unsure: %message','','none'),(264,'mollom.module:996','default','Incorrect CAPTCHA','','none'),(265,'mollom.module:1000','default','Correct CAPTCHA','','none'),(266,'mollom.module:1084','default','Error @errno: %server - %message - mollom.getServerList','','none'),(267,'mollom.module:1183','default','No Mollom servers could be reached or all servers returned an error -- the server list was emptied.','','none'),(268,'mollom.module:119','default','post with no checking','','none'),(269,'mollom.module:73,80,87','default','Report and delete','','none'),(270,'mollom.module:95; mollom.info:0','default','Mollom','','none'),(271,'mollom.module:103','default','Request CAPTCHA','','none'),(272,'mollom.info:0','default','Protects against comment and contact form spam.','','none'),(273,'mollom.module:187','default','Mollom is a web service that helps you moderate your site\'s content: see <a href=\"http://mollom.com\">http://mollom.com</a> for more information. By sending feedback to Mollom, you teach Mollom about the content you like and dislike, allowing Mollom to do a better job helping you moderate your site\'s content. If you want to report multiple posts at once, you can use Mollom\'s bulk operations on the content and comment administration pages.','','none'),(274,'mollom.module:299','default','Are you sure you want to report the e-mail message as inappropriate?','','none'),(275,'mollom.module:689','default','Mollom can be used to block all types of spam received on your website\'s protected forms. Each form can be set to one of the following options:','','none'),(276,'mollom.module:690','default','<strong>Text analysis and CAPTCHA backup</strong>: Mollom analyzes the data submitted on the form and presents a CAPTCHA challenge if necessary. This option is strongly recommended, as it takes full advantage of the Mollom anti-spam service to categorize your posts into ham (not spam) and spam.','','none'),(277,'mollom.module:691','default','<strong>CAPTCHA only</strong>: the form\'s data is not sent to Mollom for analysis, and a remotely-hosted CAPTCHA challenge is always presented. This option is useful when you wish to always display a CAPTCHA or want to send less data to the Mollom network. Note, however, that forms displayed with a CAPTCHA are never cached, so always displaying a CAPTCHA challenge may reduce performance.','','none'),(278,'mollom.module:692','default','<strong>No protection</strong>: Mollom is not used with this form.','','none'),(279,'mollom.module:693','default','Data is processsed and stored as explained in our <a href=\"http://mollom.com/service-agreement-free-subscriptions\">Web Service Privacy Policy</a>. It is your responsibility to provide any necessary notices and obtain the appropriate consent regarding Mollom\'s use of your data. For more information, see <a href=\"http://mollom.com/how-mollom-works\">How Mollom Works</a> and the <a href=\"http://mollom.com/faq\">Mollom FAQ</a>.','','none'),(280,'mollom.module:703','default','No protection','','none'),(281,'mollom.module:704','default','CAPTCHA only','','none'),(282,'mollom.module:705','default','Text analysis and CAPTCHA backup','','none'),(283,'mollom.module:727','default','Block all submissions of protected forms until the server problems are resolved','','none'),(284,'mollom.module:730','default','When the Mollom servers are down or otherwise unreachable, no text analysis is performed and no CAPTCHAs are generated. If this occurs, your Drupal site will use the configured fallback strategy, and will either accept all submissions without spam checking, or block all submissions until the server or connection problems are resolved. Subscribers to <a href=\"@pricing\">Mollom Plus</a> receive access to <a href=\"@sla\">Mollom\'s high-availability backend infrastructure</a>, not available to free users, reducing potential downtime.','','none'),(285,'mollom.module:737','default','In order to use Mollom, you need both a public and private key. To obtain your keys, simply <a href=\"http://mollom.com/user/register\">create a user account on mollom.com</a>, <a href=\"http://mollom.com/user\">login to mollom.com</a>, and <a href=\"http://mollom.com/site-manager/add\">create a subscription</a> for your site.  Once you created a subscription, your private and public access keys will be available from the <a href=\"http://mollom.com/site-manager\">site manager on mollom.com</a>. Copy-paste them in the form below, and you are ready to go.','','none'),(286,'mollom.module:752','default','The private key is used to prevent someone from hijacking your requests. Similar to a password, it should never be shared with anyone.','','none'),(287,'mollom.module:780','default','The spam filter installed on this site is currently unavailable. Per site policy, we are unable to accept new submissions until that problem is resolved. Please try resubmitting the form in a couple of minutes.','','none'),(288,'mollom.module:961','default','Your submission has triggered the spam filter and will not be accepted.','','none'),(289,'mollom.module:967','default'