contenu ou écriture de mauvaise qualité','fr',0,0),(236,'Signaler comme contenu non voulu, insultant ou hors-sujet','fr',0,0),(237,'Etes-vous sûr de vouloir supprimer le commentaire et le signaler?','fr',0,0),(238,'Le commentaire a été supprimé.','fr',0,0),(239,'Etes-vous sûr de vouloir supprimer %title et le signaler?','fr',0,0),(240,'Signaler comme inapproprié : @link','fr',0,0),(241,'Signaler comme inapproprié','fr',0,0),(242,'L\'e-mail a été signalé comme inapproprié.','fr',0,0),(243,'Signaler à Mollom comme spam et retirer de la publication','fr',0,0),(244,'Reporter à Mollom comme spam et supprimer','fr',0,0),(245,'Les commentaires sélectionnés ont été signalés comme inappropriés et ont été supprimés.','fr',0,0),(246,'Les commentaires sélectionnés ont été signalés comme inappropriés et ont été retirés de la publication.','fr',0,0),(247,'Les billets sélectionnés ont été signalés comme inappropriés et ont été supprimés.','fr',0,0),(248,'Les billets sélectionnés ont été signalés comme inappropriés et ont été retirés de la publication.','fr',0,0),(249,'Statistiques sur l\'usage du site','fr',0,0),(250,'Réglages de la protection du spam','fr',0,0),(251,'Protéger @name','fr',0,0),(252,'Réglages du serveur','fr',0,0),(253,'Stratégie de chute','fr',0,0),(254,'Laisser tous les formulaires non protégés et accepter toutes les soumissions','fr',0,0),(255,'Clés d\'accès à Mollom','fr',0,0),(256,'Clé publique','fr',0,0),(257,'La clé publique est utilisée pour vous identifier uniquement.','fr',0,0),(258,'Clé privée','fr',0,0),(259,'Le champ CAPTCHA est requis.','fr',0,0),(260,'mollom','fr',0,0),(261,'Ham: %message','fr',0,0),(262,'Spam: %message','fr',0,0),(263,'Non sûr: %message','fr',0,0),(264,'CAPTCHA incorrect','fr',0,0),(265,'CAPTCHA correct','fr',0,0),(266,'Erreur @errno de %server : %message - mollom.getServerList','fr',0,0),(267,'Les serveurs Molloms n\'ont pas pu être joints ou tous les serveurs ont rapporté une erreur -- la liste de serveurs était vide.','fr',0,0),(268,'billet sans vérification','fr',0,0),(269,'Signaler et supprimer','fr',0,0),(270,'Mollom','fr',0,0),(271,'Demander CAPTCHA','fr',0,0),(272,'Protège contre le spam les formulaires de commentaires et de contact.','fr',0,0),(273,'Mollom est un service en ligne qui vous aide à modérer le contenu de votre site : rendez vous sur <a href=\"http://mollom.com\">http://mollom.com</a> pour plus d\'information. En envoyant des retours d\'expérience à Mollom, vous apprenez à Mollom quels sont les contenus que vous aimez et que vous n\'aimez pas, ceci permet à Mollom de s\'améliorer et donc de vous aider à modérer le contenu de votre site. Si vous souhaitez signaler plusieurs contenus en une seule fois, utilisez les opérations de masse sur la page d\'administration du contenu et/ou des commentaires.','fr',0,0),(274,'Êtes-vous certain de vouloir signaler cet e-mail comme inapproprié ?','fr',0,0),(275,'Mollom peut être utilisé pour bloquer tout type de spam reçu par les formulaires de votre site. Chacun des formulaire peut être configuré avec les options suivantes :','fr',0,0),(276,'<strong>Analyse de texte et CAPTCHA en cas de doute</strong> : Mollom analyze les données soumises au formulaire et affiche un CAPTCHA si cela est nécessaire. Cette option est recommandée car elle tire pleinement parti des avantages du service anti-spam de Mollom pour catégoriser votre contenu en tant que \"ham\" (pas du spam) et \"spam\".','fr',0,0),(277,'<strong>CAPTCHA seul</strong> : le contenu du formulaire n\'est pas envoyé à Mollom pour être analysé, un CAPTCHA est toujours présenté (par webservice). Cette option est utile lorsque vous souhaitez toujours affiché un CAPTCHA ou si vous souhaitez envoyez moins de données au réseau de Mollom. A noter, quoiqu\'il en soit, ce formulaire affiche un CAPTCHA qui n\'est jamais mis en cache, cela peut donc réduire les performances.','fr',0,0),(278,'<strong>Pas de protection</strong>: Mollom n\'est utilisé sur ce formulaire.','fr',0,0),(279,'Les données sont analysées et stockées comme expliqué dans notre <a href=\"http://mollom.com/service-agreement-free-subscriptions\">Règlement sur la confidentialité des données personnelles</a>. Il est de votre responsabilité de fournir tous les avertissements nécessaires, et d\'obtenir les consentements appropriés sur l\'usage des données réalisé par Mollom. Pour plus d\'information, rendez-vous sur <a href=\"http://mollom.com/how-mollom-works\">How Mollom Works</a> et la <a href=\"http://mollom.com/faq\">FAQ Mollom</a>.','fr',0,0),(280,'Aucune protection','fr',0,0),(281,'CAPTCHA seul','fr',0,0),(282,'Analyse de texte et CAPTCHA en cas de doute','fr',0,0),(283,'Bloquer toutes les soumissions des formulaires tant que les problèmes du serveur ne sont pas résolus','fr',0,0),(284,'Quand les serveurs de Mollom sont inaccessibles ou plantés, l\'analyse de texte n\'est pas exécutée et aucun CAPTCHA n\'est généré. Si cela se produit, votre site Drupal va utiliser les procédures de secours configurées, et va soit accepter toutes les soumissions sans vérifier qu\'il s\'agit de spam ou bloquer toutes les soumissions tant que le serveur ou les problèmes de connexions ne seront pas résolus. Les abonnés à <a href=\"@pricing\">Mollom Plus</a> ont accès à <a href=\"@sla\">l\'infrastructure haute disponibilité de Mollom</a>, qui n\'est pas accessibles aux utilisateurs disposant de comptes gratuits, afin de réduire les pannes éventuelles.','fr',0,0),(285,'Pour utiliser Mollom, vous avez besoin à la fois d\'une clé publique et d\'une clé privée. Pour obtenir vos clés, <a href=\"http://mollom.com/user/register\">créez un compte utilisateur sur mollom.com</a>, <a href=\"http://mollom.com/user\">connectez-vous sur mollom.com</a>, et <a href=\"http://mollom.com/site-manager/add\">créez une souscription</a> pour votre site. Copier/coller les clés dans le formulaire ci-dessous et vous êtes prêt !','fr',0,0),(286,'La clé privée est utilisée pour empêcher quelqu\'un s\'emparrer de votre requête. Comme pour un mot de passe, elle ne devrait jamais être partagée, avec quiconque.','fr',0,0),(287,'Le filtre anti-spam installé sur ce site est momentanément indisponible. Par la politique du site, nous ne pouvons pas accepter de nouvelles soumissions tant que le problème n\'est pas résolu. Veuillez ré-essayer de soumettre votre formulaire dans quelques minutes.','fr',0,0),(288,'Votre soumission a déclenché le filtre anti-spam et ne sera pas acceptée.','fr',0,0),(289,'Nous sommes désolés, mais notre filtre anti-spam pense que votre soumission pourrait être du spam. Merci de renseigner le CAPTCHA.','fr',0,0),(290,'Le CAPTCHA n\'a pas été renseigné correctement. Veuillez recommencer avec le nouveau CAPTCHA et réessayer.','fr',0,0),(291,'Reconnaissance de caractères','fr',0,0),(292,'Tapez les caractères que vous voyez dans l\'image ci-dessus : si vous ne n\'arrivez pas à les lires, soumettez le formulaire, une nouvelle image sera générée.','fr',0,0),(293,'Nous essayons de contacter les serveurs de Mollom mais nous rencontrons une erreur de réseau. Veuillez vous assurer que votre serveur web peut effectuer des requêtes HTTP vers l\'extérieur.','fr',0,0),(294,'Nous avons contacté les serveurs de Mollom afin de vérifier vos clefs : vos clefs n\'existent pas ou ne sont plus valides. veuillez vous rendre de nouveau sur la page <em>Manage sites</em> du site de Mollom : <a href=\"@mollom-user\">@mollom-user</a>.','fr',0,0),(295,'Nous avons contacté les serveurs de Mollom afin de vérifier vos clefs : les services de Mollom fonctionnent correctement. Nous sommes actuellement en train de bloquer le pourriel.','fr',0,0),(296,'Tous les serveurs Mollom étaient indisponibles : %servers, dernière erreur : @errno - %error_msg','fr',0,0),(297,'La liste des serveurs Mollom disponibles a été mise à jour : @servers','fr',0,0),(298,'Le serveur %server de Mollom a demandé à utilisé le serveur suivant dans la liste : %next.','fr',0,0),(299,'Erreur @errno de %server : %message - %method - <pre>@data